import React, { Component } from 'react';
import { Map, GoogleApiWrapper, Marker } from 'google-maps-react';

const mapStyles = {
  width: '50%',
  height: '85%'
};

export class MapContainer extends Component {
  render() {



    return (
      <div>


      <Map
        google={this.props.google}
        zoom={12.5}
        style={mapStyles}
        initialCenter={{
         lat: 37.733467,
         lng: -122.4363648
        }}
      />

      <Marker position={
        {
          lat: 37.770629,
          lng: -122.428188
        }
      }
      />

</div>



    );
  }
}

export default GoogleApiWrapper({
  apiKey: 'AIzaSyCnSDhOvVgqhllnk8dwv0UIiIEbfd5slpU'
})(MapContainer);
